updateChatTimes=function(){$.each($(".chat_time"),function(a,b){$(this).text(moment.utc($(this).attr("id")).fromNow())});$.each($(".time"),function(a,b){$(this).text(moment.utc($(this).attr("id")).fromNow())});if($(".last_login").length){$(".last_login").html("<b>Last login: </b>"+moment.utc($(".last_login").attr("id")).fromNow())}};$(document).ready(function(){updateChatTimes();setInterval(updateChatTimes,60000)});$(".big_upvote").click(function(c){c.stopPropagation();var b=$(this).attr("id");var d=$(this).attr("id").replace("upvote_","");var a="//mutualcog.com/chat/upvote";$.ajax({type:"POST",data:{id:d},url:a,success:function(e){if(e.status==1||e.status==3){$("#votes_"+d).text(e.upvotes);$("#upvote_"+d).css("color","#57bf4b");$("#downvote_"+d).css("color","")}else{if(e.status==2){$("#votes_"+d).text(e.upvotes);$("#upvote_"+d).css("color","");$("#downvote_"+d).css("color","")}else{$("#"+b).tooltip("show")}}},error:function(){}})});$(".big_downvote").click(function(b){b.stopPropagation();var d=$(this).attr("id");var c=$(this).attr("id").replace("downvote_","");var a="//mutualcog.com/chat/downvote";$.ajax({type:"POST",data:{id:c},url:a,success:function(e){if(e.status==1||e.status==3){$("#votes_"+c).text(e.upvotes);$("#downvote_"+c).css("color","red");$("#upvote_"+c).css("color","")}else{if(e.status==2){$("#votes_"+c).text(e.upvotes);$("#upvote_"+c).css("color","");$("#downvote_"+c).css("color","")}else{$("#"+d).tooltip("show")}}},error:function(){}})});